sources.card.css:
:root {
	--width: 672px;
	--height: 966px;
	--halfW: 336px;
	--quatW: 168px;
	--borderW: 6px;
}
*, ::before, ::after {
	box-sizing: border-box;
	padding: 0;
	margin: 0;
}

/*
	main 672*966
	card 744*1038
	total 816*1110
*/

html, body {
/*	font-family: Zapfino;
	font-family: 'Academy Engraved LET';
	font-family: Luminari;
	font-family: Krungthep;
	font-family: SignPainter;
	font-family: Nanum Pen Script;

	font-family: Hiragino Maru Gothic ProN;
	font-family: YuKyokasho;*/
	font-family: Tsukushi A Round Gothic;
}
body {
	display: flex;
	justify-content: center;
	align-items: center;
	min-width: 816px;
	min-height: 1110px;
}
.container {
	position: relative;
	display: flex;
	justify-content: center;
	align-items: center;
	width: 816px;
	height: 1110px;
	margin: auto;
	background-size: 100% auto;
	background-color: #013;
	overflow: hidden;
}
.container::before {
	content: '';
	position: fixed;
	top: 0;
	left: 0;
	width: 100%;
	height: 100%;
	background-image: url(bg.png);
	background-size: cover;
	opacity: .1;
}
.frame {
	position: relative;
	width: var(--width);
	height: var(--height);
	overflow: hidden;
}


/*.frame::before,*/
.frame::after {
	content: '';
	position: absolute;
	width: 6px;
	height: 483px;
	border-radius: 3px;
}
.frame::before {
	top: 0;
	left: 0;
	background: linear-gradient(to bottom, transparent, #049, #fff 95%, transparent);
}
.frame::after {
	bottom: 0;
	right: 0;
	background: linear-gradient(to top, transparent, #049, #fff 95%, transparent);
}
[frame-type='diamond']::before {
	background: linear-gradient(to bottom, transparent, #049, #fff 95%, transparent);
}
[frame-type='club']::before {
	background: linear-gradient(to bottom, transparent, #049, #fff 85%, transparent 90%, #fff 95%, transparent);
}
[frame-type='heart']::before {
	background: linear-gradient(to bottom, transparent, #049, #fff 75%, transparent 80%, #fff 85%, transparent 90%, #fff 95%, transparent);
}
[frame-type='spade']::before {
	background: linear-gradient(to bottom, transparent, #049, #fff 65%, transparent 70%, #fff 75%, transparent 80%, #fff 85%, transparent 90%, #fff 95%, transparent);
}
[frame-type='diamond']::after {
	background: linear-gradient(to top, transparent, #049, #fff 95%, transparent);
}
[frame-type='club']::after {
	background: linear-gradient(to top, transparent, #049, #fff 85%, transparent 90%, #fff 95%, transparent);
}
[frame-type='heart']::after {
	background: linear-gradient(to top, transparent, #049, #fff 75%, transparent 80%, #fff 85%, transparent 90%, #fff 95%, transparent);
}
[frame-type='spade']::after {
	background: linear-gradient(to top, transparent, #049, #fff 65%, transparent 70%, #fff 75%, transparent 80%, #fff 85%, transparent 90%, #fff 95%, transparent);
}

.line {
	z-index: 2;
	width: 6px;
	background: linear-gradient(-36.25deg, transparent, #049, #fff, #049, transparent);
}

.num {
	position: absolute;
	top: 25%;
	left: 25%;
	width: 50%;
	height: 50%;
	transform: translate(-50%, -50%);
}


[class*="line-"] {
	position: absolute;
	width: 6px;
	height: 50.05%;
}

.circle {
	width: calc(var(--width) / 2);
	height: calc(var(--width) / 2);
	/*height: calc(var(--width) / 2);*/
	border-radius: 50%;
}
.circle::before {
	content: '';
	position: absolute;
	top: var(--borderW);
	left: var(--borderW);
	width: calc(var(--width) / 2 - var(--borderW) * 2);
	height: calc(var(--width) / 2 - var(--borderW) * 2);

	background: #013;
	border-radius: 50%;
	overflow: hidden;
}
.circle--angle,
.circle--angle::before {
	border-radius: 0 50% 50% 50%;
}



/* 0 */
.line-0-1 {
	width: 100%;
	height: 100%;
	border-radius: 50%;
}
.line-0-1::before {
	height: calc(var(--height) / 2 - var(--borderW) * 2);;
}



/* 1 */
.line-1-1 {
	height: 25%;
	left: 36.5%;
	transform: translate(0, -12%) rotate(45deg);
	background: linear-gradient(to bottom, #fff, #049, transparent);
}
.line-1-2 {
	top: 0;
	height: 100%;
	left: 49.5%;
	background: linear-gradient(to bottom, #fff, #049, transparent, #049, #fff);
}
.line-1-3 {
	bottom: 0;
	left: 25%;
	width: 50%;
	height: 6px;
	background: linear-gradient(to right, transparent, #049, #fff, #049, transparent);
}



/* 2 */
.line-2-1 {
	background: linear-gradient(150deg, #049, #fff, #049, transparent, #049, #fff, #fff);
}
.line-2-1::after {
	position: absolute;
	display: block;
	content: '';
	top: 21%;
	left: 0;
	width: 80%;
	height: 80%;
	background: #013;
}
.line-2-2 {
	width: 10px;
	left: 46.1%;
	bottom: 0;
	height: 40%;
	transform: skew(-51deg, 0);
	background: linear-gradient(to top, transparent, #049, #fff);
}
.line-2-3 {
	bottom: 0;
	left: 10%;
	width: 90%;
	height: 6px;
	background: linear-gradient(to right, #fff, #049, transparent);
}



/* 3 */
.line-3-1 {
	transform: translate(0, -15%) scale(1, .7);
	background: linear-gradient(-30deg, transparent, #049, #fff, #049, transparent, #049, #fff, #fff);
}
.line-3-2 {
	bottom: 0;
	transform: translate(0, 10%) scale(1, .8);
	background: linear-gradient(to bottom, transparent, #049, #fff, #049, transparent, #049, #fff, #fff);
}
.line-3-1::after,
.line-3-2::after {
	content: '';
	position: absolute;
	top: 0;
	left: -5%;
	width: 71%;
	height: 75%;
	background: #013;
}
.line-3-1::after {
	top: auto;
	bottom: 0;
	width: 60%;
	height: 85%;
}



/* 4 */
.line-4-1 {
	left: 30%;
	height: 60%;
	transform: skew(-35deg, 0);
}
.line-4-2 {
	top: 60%;
	width: 100%;
	height: 6px;
}
.line-4-3 {
	left:  60%;
	height: 100%;
}



/* 5 */
.line-5-1 {
	top: 0;
	width: 100%;
	height: var(--borderW);
	background: linear-gradient(to right, transparent, #049, #fff 25%, #049, transparent);
}
.line-5-2 {
	background: linear-gradient(to bottom, transparent, #049, #fff 25%, #049, transparent);
}
.line-5-3 {
	bottom: 0;
	background: linear-gradient(15deg, #049, #fff, #049, transparent, #049, #fff, #fff);
}
.line-5-3::after {
	content: '';
	position: absolute;
	top: 20%;
	left: -5%;
	width: 60%;
	height: 60%;
	background: #013;
	transform: rotate(30deg);
	border-radius: 40% 0 0 0;
}



/* 6 */
.line-6-1 {
	bottom: 0;
	right: 0;
	width: calc(var(--width) / 2);
	height: calc(var(--width) / 2);

	background: linear-gradient(60deg, #049, #fff, #049, transparent, #049, #fff, #049);
	border-radius: 50%;
}
.line-6-1::before {
	content: '';
	position: absolute;
	top: 6px;
	left: 6px;
	width: 324px;
	height: 324px;

	background: #013;
	border-radius: 50%;
	overflow: hidden;
}
.line-6-2 {
	bottom: 46%;
	left: 22%;
	height: 49%;

	transform: skew(-30deg, 0);
	background: linear-gradient(to top, transparent, #fff, #049, transparent, #049, #fff);
}


.line-base {
	bottom: -20%;
	width: 100%;
	height: 3px;
}


/* 7 */
.line-7-1 {
	width: 102%;
	height: 6px;
	background: linear-gradient(to right, transparent, #049, #fff);
}
.line-7-2 {
	left: 49%;
	height: 100%;
	transform: skew(-36.25deg, 0);
	background: linear-gradient(to bottom, #fff, #049, transparent);
}




/* 8 */
.line-8-1 {
	z-index: 3;
	background: linear-gradient(90deg, #fff 15px, transparent 15px, #049, #fff, #049, #fff);
	transform: translate(-9.5%, -22.5%) rotate(-135deg) scale(.54);
}
.line-8-2 {
	bottom: 0;
	background: linear-gradient(135deg, transparent, #049, #fff 48px, #049, #fff);
	transform: translate(0, 12%) rotate(45deg) scale(.75);
}
[class*="line-8-"]::before {
	width: 309px;
	height: 318px;
	top: 6px;
	left: 24px;
}
.line-8-2::before {
	width: 312px;
	height: 312px;
	top: 15px;
	left: 12px;
}



/* 9 */
.line-9-1 {
	top: 0;
	right: 0;
	width: calc(var(--width) / 2);
	height: calc(var(--width) / 2);
	background: linear-gradient(60deg, #049, #fff, #049, transparent, #049, #fff, #049);
	border-radius: 50%;
}
.line-9-1::before {
	content: '';
	position: absolute;
	top: 6px;
	left: 6px;
	width: 324px;
	height: 324px;
	background: #013;
	border-radius: 50%;
	overflow: hidden;
}
.line-9-2 {
	top: 46%;
	right: 22%;
	height: 49%;

	transform: skew(-30deg, 0);
	background: linear-gradient(to bottom, transparent, #fff, #049, transparent, #049, #fff);
}



.line-10-1,
.line-11-1,
.line-12-1,
